import React from 'react'

const SignUp = () => {
    return (
        <div>
            <h1>Ready to be a member?</h1>
            <form>
                <label>
                    Name:
                    <input type="text" name="name" />
                </label>
                <input type="submit" value="Submit" />
            </form>
        </div>
    )
}

export default SignUp;
